def bin_search(book, who):
    if not book:
        return -1
    m = len(book) // 2

    if book[m][0] == who:
        return book[m]
    elif book[m][0] < who:

        return bin_search(book[m+1:], who)
    elif book[m][0] > who:

        return bin_search(book[:m], who)


who = 'Adam Burchess'

